const MoveList = ({moveList}) => {
    const sortedMoveList = moveList.sort((a, b) => {
        if(a.level > b.level) {
            return 1
        } else {
            return -1
        }
    })

    const mapMoveList = sortedMoveList.map(move => {
        return (
            <div>
                {move.name} leveled Required: {move.level} {move.method}
            </div>
        )
    })

    return (
        <table>
            <thead>
                <tr>
                    <th>Move</th>
                    <th>Level Requirement</th>
                </tr>
            </thead>
            <tbody>

            </tbody>
        </table>
    )
}

export default MoveList
